function displayErrors(){let e=new URLSearchParams(window.location.search),t=e.get("err"),n=document.getElementById("error");if(t){switch(t){case"0":n.innerText="500 internal server error",n.style.display="unset";case"1":n.innerText="email already in use",n.style.display="unset";case"2":n.innerText="min password length is 8",n.style.display="unset"}History.replaceState({},"Create Account - 766 Scouting",window.location.origin+window.location.pathname)}}